// import Project from '../Project';
import githubIcon from '../../assets/github.png'
import screenOne from '../../assets/projects/notetake.jpeg'; 
import screenTwo from '../../assets/projects/employeetrack.jpeg';
import screenThree from '../../assets/projects/teamcontact.jpeg';
import screenFour from '../../assets/projects/weatherdash.jpeg';

function Portfolio(){
    const [project] = useState([
        {
            name: 'notetake',
            description: 'Write, save and delete notes with this note taking application.',
            deployedLink: "https://github.com",
            github: "https://github.com",
            imgLink: screenOne
        },
        {
            name: 'employeetrack',
            description: 'Employee tracking app. Plan and organize; department, roles, and employees.',
            github: "https://github.com",
            imgLink: screenTwo
        },
        {
            name: 'teamcontact',
            description: 'Construct your team contact webpage; add employees and management with their necessary contact information.',
            github: "https://github.com",
            imgLink: screenThree
        },
        {
            name: 'weatherdash',
            description: 'Search for weather forecasts specific to any location and keep track of them for further use.',
            deployedLink: "https://github.com",
            github: "https://github.com",
            imgLink: screenFour
        },
    ]);
    const projectList = project.map((project, i) =>
    <div>
        <br/>
        <span>
        <a href={project.github} target="_blank" rel="noreferrer">
                    <img src={githubIcon} alt style={{width: "3%"}}></img>
          </a>
                   <a href={`${project.deployedLink}`} target="_blank" rel="noreferrer">
                    {project.name}
                </a>
              <div className="backgroundImage" style = {{ backgroundImage: `url(${project.imageLink})` }}
              onClick={()=>window.open(`${project.deployedLink}`, "_blank")}>
                {/* <a href={`${project.deployedLink}`} target="_blank" rel="noreferrer"> */}
                    {/* {project.name} */}
                {/* </a> */}
                <br></br>
                </div>
                </span>                          
        <br/>
    </div>
)
console.log(project[1].name)
return (
    <div>
        <h1>Portfolio</h1>
        <div>
            {projectList}
        </div>
    </div>
);

}

export default Portfolio;
